// src/components/Dashboard.js
import React from "react";
import "../styles.css"; // Ensure global styles or Tailwind included
import { useNavigate } from "react-router-dom";

const exercises = [
  {
    title: "Neurological",
    desc: "Exercises for patients with cerebral palsy, Parkinson’s, and stroke recovery.",
  },
  {
    title: "Physiotherapy",
    desc: "Rehabilitation for joint mobility, posture, and pain relief (arm, shoulder, spine).",
  },
  {
    title: "Orthopedic",
    desc: "Targeted recovery from ACL tears, spinal disc issues, and shoulder injuries.",
  },
  {
    title: "Cardiac",
    desc: "Heart rehab for post-heart attack, hypertension, and general fitness recovery.",
  },
];

const Dashboard = () => {
  const navigate = useNavigate();

  const handleStart = (category) => {
    // You can later pass the category to ExerciseSelector or another route
    navigate("/exercise-selector");
  };

  const handleLogout = () => {
    navigate("/login");
  };

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <h1 className="dashboard-title">AI Rehab Dashboard</h1>
        <button className="logout-button" onClick={handleLogout}>Logout</button>
      </header>

      <div className="main-content">
        {exercises.map((item, idx) => (
          <div key={idx} className="card">
            <h2>{item.title}</h2>
            <p>{item.desc}</p>
            <button className="start-button" onClick={() => handleStart(item.title)}>Start</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Dashboard;
